	<script type="text/javascript">
		//alert(typeof document.getElementsByClassName);
		function apan (gagan) {
			alert("Yeah");
		}
		var GA = {
			apan : function () {
				/*
					$('div.我 p:first-child)').each( function()

					$('#中文 #大').each( function() { this.style.backgroundColor = 'red'; });
					$('#中文.我 .小[title=他]').each( function() { this.style.backgroundColor =

				*/
				$("#container").cssSelect("td").setStyle({
					background : "#faa",
					color : "red",
					"border-left" : "10px solid red"
				});
				$("#container").setStyle("border", "10px solid red");
				$("#aaa.bbb").addEvent("click", other);
				$("#aaa.bbb").addEvent("click", other);
				$("#aaa.bbb").addEvent("click", other2);
			}
		};
		function other () {
			alert("Overridden");
		}
		function other2 () {
			alert("Still works");
			$("#aaa.bbb").removeEvent("click", other);
			$("#aaa.bbb").addEvent("click", other);
		}
		DOMAssistant.DOMReady(GA.apan);
		DOMAssistant.DOMReady(GA.apan);
	</script>
